// Actions
const SELECT_VIDEO = 'SELECT_SONG';
const GET_VIDEOS = 'GET_VIDEOS';

// Generators

export const selectVideo = video => {
  return {
    type: SELECTED_VIDEO,
    payload: video
  };
};

export const getVideos = videos => {
  return {
    type: GET_VIDEOS,
    payload: videos
  };
};
